import React from 'react'
import { useParams, Link as RouterLink, useNavigate } from 'react-router-dom'
import { projects } from '../data/projects'
import {
  Box,
  Typography,
  Breadcrumbs,
  Link,
  Button,
  Stack,
  Divider,
} from '@mui/material'
import HomeIcon from '@mui/icons-material/Home'
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth'
import LocationOnIcon from '@mui/icons-material/LocationOn'

const slugify = (text) =>
  text.toLowerCase().replace(/[^\w ]+/g, '').replace(/ +/g, '-')

const projectsWithSlugs = projects.map((p) => ({
  ...p,
  slug: slugify(p.title),
}))

export default function ProjectDetail() {
  const { slug } = useParams()
  const project = projectsWithSlugs.find((p) => p.slug === slug)
  const navigate = useNavigate()

  if (!project) {
    return (
      <Box
        sx={{
          minHeight: '80vh',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          px: 3,
        }}
      >
        <Typography variant="h4" color="error" gutterBottom>
          Project Not Found
        </Typography>
        <Typography variant="body1" sx={{ mb: 3 }}>
          Sorry, we couldn’t find what you’re looking for.
        </Typography>
        <Button variant="contained" onClick={() => navigate('/')} size="large">
          Back to Home
        </Button>
      </Box>
    )
  }

  const extras = Array.isArray(project.images) ? project.images : []
  const allImages = [project.image, ...extras].slice(0, 3)

  const goToProjects = () => {
    navigate('/')
    setTimeout(() => {
      document.getElementById('projects')?.scrollIntoView({ behavior: 'smooth' })
    }, 50)
  }

  return (
    <Box
      sx={{
        maxWidth: 900,
        mx: 'auto',
        px: { xs: 3, md: 6 },
        pt: { xs: 4, md: 8 },
        pb: 8,
        backgroundColor: 'transparent',
      }}
    >
      {/* Breadcrumbs */}
      <Breadcrumbs aria-label="breadcrumb" sx={{ mb: 4 }}>
        <Link
          component={RouterLink}
          to="/"
          underline="none"
          color="text.secondary"
          sx={{ display: 'flex', alignItems: 'center' }}
        >
          <HomeIcon fontSize="small" sx={{ mr: 0.5 }} />
          Home
        </Link>

        <Link
          component="button"
          onClick={goToProjects}
          underline="none"
          color="text.secondary"
          sx={{ cursor: 'pointer' }}
        >
          Projects
        </Link>

        <Typography color="primary.main" sx={{ fontWeight: 600 }}>
          {project.title}
        </Typography>
      </Breadcrumbs>

      {/* Title */}
      <Typography
        variant="h3"
        component="h1"
        sx={{ fontWeight: 700, mb: 3, letterSpacing: 0.5 }}
      >
        {project.title}
      </Typography>

      {/* Meta */}
      <Stack direction="row" spacing={4} mb={4} flexWrap="wrap">
        <Stack direction="row" spacing={1} alignItems="center" color="text.secondary">
          <CalendarMonthIcon /> <Typography>{project.date}</Typography>
        </Stack>
        <Stack direction="row" spacing={1} alignItems="center" color="text.secondary">
          <LocationOnIcon /> <Typography>{project.location}</Typography>
        </Stack>
      </Stack>

      {/* Images */}
      <Box mb={5}>
        {/* Main image */}
        <Box
          component="img"
          src={allImages[0]}
          alt={`${project.title} main`}
          loading="lazy"
          sx={{
            width: '100%',
            maxHeight: 350,
            objectFit: 'contain',
            borderRadius: 2,
          }}
        />

        {/* Thumbnails */}
        {allImages.length > 1 && (
          <Stack direction="row" spacing={2} mt={2}>
            {allImages.slice(1).map((img, idx) => (
              <Box
                key={idx}
                component="img"
                src={img}
                alt={`${project.title} ${idx + 2}`}
                loading="lazy"
                sx={{
                  width: 100,
                  objectFit: 'contain',
                  borderRadius: 1,
                  cursor: 'pointer',
                  transition: 'transform 0.2s',
                  '&:hover': { transform: 'scale(1.1)' },
                }}
                onClick={() =>
                  document
                    .querySelector('img[alt^="' + project.title + ' main"]')
                    ?.scrollIntoView({ behavior: 'smooth' })
                }
              />
            ))}
          </Stack>
        )}
      </Box>

      <Divider sx={{ mb: 5 }} />

      {/* Description */}
      <Typography
        variant="body1"
        sx={{ mb: 6, whiteSpace: 'pre-line', lineHeight: 1.7 }}
        dangerouslySetInnerHTML={{ __html: project.description }}
      />

      {/* Back button */}
      <Box textAlign="center">
        <Button variant="outlined" onClick={goToProjects}>
          ← Back to Projects
        </Button>
      </Box>
    </Box>
  )
}
